import React from 'react';
import { css } from 'emotion'

const AboutMe = () => {
    return (
    <div id={"here"} className={styles.aboutme}>
        <p>I am a Full Stack Software Engineer with a background as a Math Teacher and in business. I am passionate about solving algorithms and user experience. I have a strong knowledge of many tools, such as Python and Angular, but a special love for JavaScript and React. Click below to know a little about my background</p>
    </div>
    )
}

const styles = {
    aboutme: css`
    font-size: 23px;
    text-align: justify;
    text-decoration: none;
    text-indent: 50px;
    widht: 700px;




    `,
}


export default AboutMe;
